import React from "react";

function Spinner(props)
{
	let classes = `loader ${props.position}`
	return (
		<div className={ classes }>
			<div className="lds-ring">
				<div></div>
				<div></div>
				<div></div>
				<div></div>
			</div>
		</div>
	);
}

export default Spinner;
